// imports
import React from "react";

// booking button
function Booking() {
  return (
    <div>
      <div class="d-grid gap-2 w-30">
        <button class="btn btn-outline-success" type="button">
          Book Us
        </button>
      </div>
    </div>
  );
}

export default Booking;
